import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class Projects extends Component {
  render() {
    return (
      <div className="projects-container">
      <div className="row">
        <div className="column">Here is some stuff</div>
        <div className="column">Here is some stuff</div>
        <div className="column">Here is some stuff</div>
        </div>
      </div>
    );
  }
}

export default Projects;

